import React from 'react';
import styled from 'styled-components';
import { slideUp } from '../../style/keyframes';

const Manual: React.FC = () => {
    return (
        <Screen>
            <FlexBox>
                <div style={{ fontSize: '40px' }} > 여기다가 대충 설명 해줌 </div>
            </FlexBox>
        </Screen>
    )
}

export default Manual;

const FlexBox = styled.div`
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    width: 100%;
    height: 100%;
`;

const Screen = styled.div`
    position: absolute;
    left: 10px;
    bottom: 18px;
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    width: 80.5%;
    min-width: 300px;
    height: 81.5%;
    border-radius: 30px;
    padding: 10px;
    overflow: auto;
    background-color: ${({ theme }) => theme.colors.black20};
    animation: ${slideUp} 1s ease;
    transition: 1s ease;
    z-index: 1;
    @media only screen and (max-width: 500px) {
        width: 96%;
    }
`;
